import React from 'react'
import { Parallax } from 'react-scroll-parallax'

const ParallaxImage = () => (
  <Parallax className='custom-class' y={[-20, 20]} tagOuter='figure'>
      <Image src='/assets/img/urb-reception.jpg' />
    </Parallax>
)

class ParallaxTest extends React.Component {
  render () {
    return (
      <div>

        <Parallax className='work-image--bg' y={[-10, 10]} tagOuter='figure'>
          <img src='/assets/img/urb-reception.jpg' alt='placeholder' />
        </Parallax>
        <Parallax className='work-image--fg' y={[-40, 40]} tagOuter='figure'>
          <img src='/assets/img/urb-reception.jpg' alt='placeholder' />
        </Parallax>
      </div>
    )
  }
}
export default ParallaxTest
